		this.mainframe = frame;
		this.mainframe.getContentPane().removeAll();
		this.mainframe.getContentPane().revalidate();
		this.mainframe.setBackground(Color.BLACK);
		this.mainframe.setTitle("Choose Players");

		JPanel mainPanel = new JPanel();

		ButtonGroup group = new ButtonGroup();
		JRadioButton rb3 = new JRadioButton("3", true);
		JRadioButton rb4 = new JRadioButton("4", false);
		JRadioButton rb5 = new JRadioButton("5", false);
		group.add(rb3);
		group.add(rb4);
		group.add(rb5);

		JButton startButton = new JButton("Start");
		startButton.addActionListener(new ButtonHandler(this.mainframe, group));

		mainPanel.add(rb3);
		mainPanel.add(rb4);
		mainPanel.add(rb5);
		mainPanel.add(startButton);

		this.mainframe.add(mainPanel);
	}

}

package csse376_puerto_rico;

import java.util.ArrayList;
import java.util.List;

/**
 * List of roles
 *
 * @author songm. Created Apr 22, 2015.
 */
public enum PlayerRoles {
	Settler, Builder, Craftsman, Trader, Captain, Prospector, Mayor;

	private PlayerRoles() {
		// null constructor
	}

	public static List<String> getValues() {
		List<String> rtn = new ArrayList<String>();

		for (PlayerRoles v : PlayerRoles.values()) {
			rtn.add(v.toString());
		}

		return rtn;
	}
}

package csse376_puerto_rico;

import java.util.ArrayList;
import java.util.Arrays;
import java.util.HashMap;
import java.util.List;

import javax.swing.JTextArea;

public class Player {

	private String role;
	private JTextArea hud;
	public boolean isTurn;
	public boolean isGovernor;
	private int points = 0;
	private ArrayList<String> buildings = new ArrayList<String>();
	class Good {
		public static final String COFFEE = "Coffee";
		public static final String TOBACCO = "Tobacco";
		public static final String CORN = "Corn";
		public static final String SUGAR = "Sugar";
		public static final String INDIGO = "Indigo";
	}

	private HashMap<String, Integer> goods = new HashMap<String, Integer>();
	private static List<String> roles = PlayerRoles.getValues();

	// For Testing purposes, null player
	public Player() {
		this.role = "";
		this.isGovernor = false;
		this.hud = new JTextArea();
		for (String s : this.getAllGoods()) {
			this.goods.put(s, 0);
		}
	}

	public Player(String role) {
		this.role = role;
		this.isGovernor = false;
		this.isTurn = false;
		this.hud = null;
		for (String s : this.getAllGoods()) {
			this.goods.put(s, 0);
		}
	}

	public String getRole() {
		return this.role;
	}

	public static List<String> getRoles() {

		return roles;
	}

	public int getPoints() {
		return points;
	}

	public JTextArea getHUD() {
		return this.hud;
	}

	public void setHUD(JTextArea hud) {
		this.hud = hud;
	}

	public boolean isGovernor() {
		return isGovernor;
	}

	// Test method
	public void setPoints(int points) {
		// This method is strictly for setting points
		this.points = points;
	}

	public void setRole(String string) {
		this.role = string;
	}

	public void addBuilding(String building) {
		buildings.add(building);
	}

	public ArrayList<String> getBuildings() {
		return buildings;
	}

	public List<String> getGoods() {
		//
		List<String> rtn = new ArrayList<String>();
		String coffee = "Coffee: " + Integer.toString((getNumberOfGood("Coffee")));
		String tobacco = "Tobacco: " + Integer.toString((getNumberOfGood("Tobacco")));
		String corn = "Corn: " + Integer.toString((getNumberOfGood("Corn")));
		String sugar = "Sugar: " + Integer.toString((getNumberOfGood("Sugar")));
		String indigo = "Indigo: " + Integer.toString((getNumberOfGood("Indigo")));
		rtn.addAll(Arrays.asList(coffee, corn, tobacco,
				sugar, indigo));
		return rtn;
	}

	public int getNumberOfGood(String good) {
		//added case where there were no goods
		if(this.goods.get(good) == null)
		{
			return 0;
		}
		return this.goods.get(good);

	}
	
	public List<String> getAllGoods()
	{
			List<String> rtn = new ArrayList<String>();
			rtn.addAll(Arrays.asList(Good.COFFEE, Good.CORN, Good.INDIGO,
					Good.SUGAR, Good.TOBACCO));
			return rtn;	
	}

	public void addGood(String good, int number) {
		// adds the number to the original
		this.goods.put(good, this.goods.get(good) + number);
	}
	
}

package csse376_puerto_rico;

import java.awt.event.ActionEvent;
import java.awt.event.ActionListener;
import java.util.ArrayList;
import java.util.List;

import javax.swing.JButton;

public class NextMoveButton extends JButton 
{
	private List<Player> players;
	public NextMoveButton()
	{
		players = GameBoardGUI.players;
		final ArrayList<Integer> count = new ArrayList<Integer>();
		final Integer zero = 0;
		count.add(zero);
		this.addActionListener(new ActionListener() {
			
			@Override
			public void actionPerformed(ActionEvent e) {
				Integer newCount = count.get(0);
				newCount = newCount +1;
				count.remove(0);
				count.add(newCount);
				if(newCount > 0 && newCount % players.size() ==0)
				{
					Integer finalCount = newCount/players.size();
					setText("Turn " +finalCount.toString());
				}
				
				makeMove();
			}
		});
	}
	public void makeMove()
	{
		//once you find the first true isTurn value, 
		//you should set it off to mark that player's turn has ended
		//then you mark the next player's turn has started by turning its isTurn value as true
		//once these changes are made, this new players list replaces the mainboard's player's list
		for(int i=0;i<players.size();i++)
		{
			if(players.get(i).isTurn)
			{
				players.get(i).isTurn = false;
				if(i == players.size()-1)
				{
					players.get(0).isTurn = true;
				}
				else
				{
					players.get(i+1).isTurn = true;
				}
				break;
			}
		}
		GameBoardGUI.players = players;
	}
}

